import React from "react";
import Cities from "./Cities";
import Restaurants from "./Restaurants";
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
            <Route path="/cities"
                   element={<Cities />}/>
        </Routes>
        <Routes>
            <Route path="/restaurants"
                   element={<Restaurants />}/>
        </Routes>
    </Router>
    </div>
  );
}

export default App;
